export default async function seedMatches(req: NextApiRequest, res: NextApiResponse) {
  const apiToken = req.query['api_token'] as string;
  if (!apiToken) {
    return res.status(500).json({
      error: {
        code: 'server_error',
        message: 'Internal server error',
      },
    });
  }

  // Make sure the API token has access to the CMA, and is stored securely
  const client = buildClient({ apiToken, logLevel: LogLevel.BODY_AND_HEADERS });
  const items = map(chunk(shuffle(allParticipants), 2), async (participants, index) => {
    const matchId = allMatches[index].id;
    const item = await client.items.update(matchId, {
      id: matchId,
      participants: participants.map(({ id }) => {
        return id;
      }),
    });
    console.log(item);
    return item;
  });

  return res.status(200).json(items);
}
